import './Header.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Header() {
  return (
    <Container>
      <Row>
        <Col xs={8}>
          <h1>Wellfield is building technology that unlocks the future of decentralized finance.</h1>
        </Col>
      </Row>
    </Container>
  );
}

export default Header;
